def binary_search(lst, target):
    low = 1
    high = len(lst) - 1
    while low <= high:
        mid = (low + high) // 2
        if lst[mid] == target:
            return mid
        if lst[mid] > target:
            high = mid - 1
        else:
            low = mid + 1
    return -1

